import React from 'react';
import '../../App.css';
import Map from '../Map';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Home() {

  return (

    <div className='home'>
      <h1>WELCOME</h1>
      <Link to ={path} className='btn-mobile'>
      <button
        className={`btn ${checkButtonStyle} ${checkButtonSize}`}
        onClick={onClick}
        type={type}
      >
        {children}
      </button>
    </Link>
      <p>LOGIN OR SIGN UP TO USE OUR SERVICES</p>
      <a href="map.html">Add new store</a>
    </div>
  );
}

export default Home;
